import React, { useEffect } from "react";
// import axios from "axios";
import Dress from "./Dress";
import EmptyStripe from "./EmptyStripe";
import LoadingBox from "./LoadingBox";
import MessageBox from "./MessageBox";
import { useDispatch, useSelector } from "react-redux";
import { listDress } from "../actions/dressAction";

export default function Dresses() {
  const dispatch = useDispatch();
  const dressList = useSelector((state) => state.dressList);
  const { loading, error, productDresses } = dressList;

  useEffect(() => {
    dispatch(listDress());
  }, [dispatch]);
  return (
    <div>
      <EmptyStripe />
      <section class="category" id="category">
        <div class="max-width">
          {loading ? (
            <LoadingBox></LoadingBox>
          ) : error ? (
            <MessageBox variant="error">{error}</MessageBox>
          ) : (
            <div class="category-content">
              {productDresses.map((productDress) => (
                <Dress
                  key={productDress._id}
                  productDress={productDress}
                ></Dress>
              ))}
            </div>
          )}
        </div>
      </section>
    </div>
  );
}
